import React from "react";
import "./App.css";
import mondaySdk from "monday-sdk-js";
const monday = mondaySdk();

class App extends React.Component {
  constructor(props) {
    super(props);

    // Default state
    this.state = {
      settings: {},
      name: "",
    };
  }

  componentDidMount() {
    // TODO: set up event listeners
  }

  render() {
    return (
      <div className="App">
        <a  href="https://www.w3schools.com" target="_blank">
          Bookmark Title
        </a>
        <a href="https://www.w3schools.com" target="_blank">
          Bookmark Title
        </a>
        <button onClick={() => saveBookmark()}>Add bookmark</button>
        <button onClick={() => getBookmark()}>Get bookmark</button>
      </div>
    );
  }
}

// ================= Backend ==================

function saveBookmark(){
  monday.storage.instance.setItem('url', '{url: "https://www.youtube.com/", name: "youtube"}').then(res => {
    console.log(res);
  })
}

function getBookmark(){
  monday.storage.instance.getItem('url').then(res => {
    console.log(res.data.value);
 })
}

export default App;
